    <tr>
      <td bgcolor="#ffffff"><font size="-1" color="#333333">
普段使いに最適な、シンプルなワイングラス。飾り気のない、洗練されたデザインなので、テーブルを落ち着きのある空間に演出してくれます。夜のお食事をちょっとリッチな気分で楽しめるグラスです。</font></td>
    </tr>
    <tr>
      <td bgcolor="#f3f3f3"><font size="-1" color="#333333"><b>商品詳細</b></font></td>
