        容量／約320cc（満水）<br>
        素材／ガラス　 <br>
        質感／つややか<br>
        生産地／タイ<br>
        <br>
        電子レンジ、食器洗い機使用不可<br>
取り寄せ可能<br>
      <br>
        ※サイズは全て外寸になります。<br>
        ※不明な点がございましたら、お気軽にお問い合わせ下さい。</font></td>
